import React from 'react';
import { Carousel } from 'react-responsive-carousel';


function Carrosel({ CarroselItems }) {
    return (
        <div>
            <Carousel>
                <h3>Carrosel</h3>
            </Carousel>
        </div>
    )
}

export default Carrosel;
